import './App.css';
import { Switch, Route, Link, Redirect } from "react-router-dom";
import HomePage from './pages/HomePage';
function App() {
  return (
    <div className="App">
      <h1>hello, peeps!</h1>
      <Switch>
        <Route path="login">
          <Link to="/home">Home</Link>
        </Route>

        <Route path="/home">
          <HomePage />
        </Route>
        <Route path="/">
          <Redirect to="/home"/>
        </Route>
      </Switch>
    </div>
  );
}

export default App;
